import { createSlice } from "@reduxjs/toolkit";
import { getTagsAction } from "../Action/Action";
const initialState = {
  Tags: {
    data: [],
    isLoading: false,
    isSucess: false,
    errorMessage: "",
  },
  report: {
    data: {},
    isLoading: false,
    isSucess: false,
    errorMessage: "",
  },
};



export const scrapReducer = createSlice({
  name: "scrapData",
  initialState,
  reducers: {
    // setIsfilter: (state, action) => {
    //   state.ProductListData.isFilter = action.payload;
    // },
  },
  extraReducers: {
    [getTagsAction.rejected]: (state, { payload }) => {
      state.Tags.isLoading = false;
      state.Tags.isSucess = false;
      state.Tags.ProductListData = payload;
    },
    [getTagsAction.fulfilled]: (state, { payload }) => {
      state.Tags.isLoading = false;
      state.Tags.isSucess = true;
      state.Tags.data = payload.data.items;
    },
  },
});

export const { setIsfilter } = scrapReducer.actions;

export default scrapReducer.reducer;
